ISLAMABAD, Nov 15 (APP): Senator Faisal Javed Khan on Sunday said that views at polling stations in Gilgit-Baltistan elections testify to the large number of Pakistan Tehreek-e-Insaf (PTI) voters there which indicates that PTI will be able to win a landslide victory.
In a twitter message, he said “wishing all our Pakistan Tehreek-i-Insaf (PTI) candidates best of luck and expressed hope that PTI will win. He said that “lots of prayers and best wishes for PTI candidates.
